+        switch (s.charAt(last)) {
+            case 'b':
+            case 'B': {
+                result = new BigDecimal(s.substring(0, last));
+                rclass = BigDecimal.class;
+                break;
+            }
+            case 'd':
+            case 'D': {
+                rclass = Double.class;
+                result = Double.valueOf(s);
+                break;
+            }
+            case 'f':
+            case 'F':
+            default: {
+                rclass = Float.class;
+                try {
+                    result = Float.valueOf(s);
+                } catch (NumberFormatException take2) {
+                    try {
+                        result = Double.valueOf(s);
